import React, { useState } from 'react';
import { JobService } from '../services/jobs.service';
import JobComponent from './JobComponent';
import Job from './JobComponent';
// import { Job } from './entities/job';

const JobList = ({jobService} : {jobService: JobService}) => {

  // const [allJobs, setAllJobs] = useState(jobService.allJobs);  
  const job = {jobId: 301, jobTitleId: 4, city: 'New York', state: 'NY'};

  return (
    <div>
      <JobComponent job={job}></JobComponent>
    </div>
  );
}

export default JobList;
